import React from 'react';

const Header = ({data}) => {
	const rows = Object.keys(data).map((item) => {
		const row = <th>{data[item]}</th>;
		return <tr>{row}</tr>;
	});
	return <thead>{rows}</thead>;
};

export default Header;
